          {" "}
          <a href="#">Home</a>
        </li>
        <li class="nav__item">
          {" "}
          <a href="#">My Services</a>
        </li>
        <li class="nav__item">
          {" "}
          <a href="#">About me</a>
        </li>
        <li class="nav__item">
          {" "}
          <a href="#">My Work</a>
        </li>
        <li class="nav__item">
          {" "}
          <a href="#">Contact</a>
        </li>
      </ul>
    </nav>
  )
}
